import React from "react";
import Sidebar from "./Sidebar";
import Chat from "./Chat";

import "./App.css";

function App() {
  return (
    <div className="app">
      <div className="app_body">
        <Router>
          <Switch>
            <Route path="/app">
              <Sidebar />
              <Chat />
            </Route>
            <Route path="/">
                <h1>Home Screen</h1>
              </Route>
          </Switch>
        </Router>
      </div>
    </div>
  );
}

export default App;
